import styled from 'styled-components'

export const SearchBar = styled.form`
  width: 70%;

  & .searchbar__input {
    display: block;
    float: right;
    width: 60%;
    border-radius: 10px;
    padding: 10px;
    font-size: 16px;
  }
`
